function UserListings() {


    return (
      <>
      <div className='profile-user-listings'>
            <div className='profile-my-listings'>
              <h1>My Listings</h1>
              {ownProducts.map((product) => (
                <ProductListing 
                  key={product.id}
                  product={product} 
                  isRemovable={true}
                  removeSelf={() => removeProduct(product.id)}
                />
              ))}
            </div>
        </div>
      </>
    );
  }

  export default UserListings;
